import './index.css';
import Profile from './profile'


class Details{
 Profile=()=>{
    <div className="profile">
    <img id="y" src={props.profileImg} alt='profileImg'/>
    <p className='name'>{props.name}</p>
    <h4>Location</h4>
    <p>{props.location}</p>
    <h4>Blood group</h4>
    <p>{props.bloodGroup}</p>
    <h4>Age</h4>
    <p>{props.age}</p>
    </div>
  }
}
let App=()=>{
  <Details employee={employee}/>
}
export default App;

